package _459RepeatedSubstringPattern

import (
	"testing"

	"github.com/stretchr/testify/assert"
)

func Test_repeatedSubstringPattern(t *testing.T) {
	t.Run("demo1", func(t *testing.T) {
		assert.Equal(t, false, repeatedSubstringPattern("aba"))
	})
	t.Run("demo2", func(t *testing.T) {
		assert.Equal(t, true, repeatedSubstringPattern("bb"))
	})
	t.Run("demo2", func(t *testing.T) {
		assert.Equal(t, false, repeatedSubstringPattern(""))
	})
}
